import '../../domain/entities/task_entities.dart';class TaskModel extends TaskEntities {  TaskModel({    this.id,    this.image,    this.title,    this.desc,    this.priority,    this.status,    this.user,    this.createdAt,    this.updatedAt,    this.v,  }) : super(          id: id,          image: image,          title: title,          desc: desc,          priority: priority,          status: status,        );  TaskModel.fromJson(dynamic json) {    id = json['_id'];    image = json['image'];    title = json['title'];    desc = json['desc'];    priority = json['priority'];    status = json['status'];    user = json['user'];    createdAt = json['createdAt'];    updatedAt = json['updatedAt'];    v = json['__v'];  }  @override  String? id;  @override  String? image;  @override  String? title;  @override  String? desc;  @override  String? priority;  @override  String? status;  String? user;  String? createdAt;  String? updatedAt;  num? v;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['_id'] = id;    map['image'] = image;    map['title'] = title;    map['desc'] = desc;    map['priority'] = priority;    map['status'] = status;    map['user'] = user;    map['createdAt'] = createdAt;    map['updatedAt'] = updatedAt;    map['__v'] = v;    return map;  }}